    null,nt"notes": "Treasury plans to sell up to $10 billion of securities per
    month, subject to market conditions.  This is in addition to principal paydowns
    (currently ranging between $2 and $4 billion per month).   If the sales proceeded
    at the full $10 billion per month, the portfolio would be unwound in whole over
    approximately one year, depending on future rates of prepayments. If market conditions
    change and Treasury slows asset sales, it is possible that the unwind will take
    a longer period of time.",nt"owner_org": "5a2fc6dd-f2cc-4bae-878b-c70576a26757",nt"extras":
